var requestOptions = {
    method: "get",
    headers: myHeaders,
    redirect: "follow",

};

fetch("https://v1.nocodeapi.com/emircankocatepe/google_sheets/HILItNTkYdoXLExR?tabId=Sayfa1&row_id=7", requestOptions)
    .then(response => response.text())
    .then(result => console.log(result))
    .catch(error => console.log('error', error));

const App = () => {

  return (
    <BrowserRouter>
    <Routes>
      <Route path='/' element={<Login/>}></Route>
      <Route path="/mainpage" element={<MainPage />}></Route>
      <Route path="/seatselection" element={<SeatSelection/>}></Route>
      <Route path="/confirmationscreen" element={<ConfirmationScreen/>}></Route>
      </Routes>
    </BrowserRouter>
  )
}


export default App;
